import React from 'react';
import { Link } from 'react-router-dom';
import LogoAm from '../../assets/images/logo.svg'
import './index.scss'



const Sidebar = () => {
    return (
        <div className='nav-bar'>
            <Link className='logo' to="/">
              <img src={LogoAm} alt='logo AM'/>
            </Link>
        </div>
    );
};

export default Sidebar;
